package main

import (
	"fmt"
)

func main() {
	input := ""
	last_four := make([]int32, 4)

	for i, c := range input {
		last_four[i%4] = c
		// fmt.Println(last_four)
		if uniqueSlice(last_four) {
			fmt.Println("unique! ", i+1)
			return
		}
	}
}

func uniqueSlice(s []int32) bool {
	count := make(map[int32]int)
	for _, v := range s {
		if v == 0 {
			return false
		}
		count[v] += 1
		if count[v] > 1 {
			return false
		}
	}
	return true
}
